"use strict";

console.log("===== == Equal or Double Equal or loosely equal Operator ========");
var numOne = 10;
var numTwo = 10;
var numThree = "10";
var numFour = 20;
console.log(" Is numOne equal to numTwo ==> ".concat(numOne == numTwo));
console.log(" Is numOne equal to numThree ==> ".concat(numOne == numThree));
console.log(" Is numOne equal to numFour ==> ".concat(numOne == numFour));
console.log("===== === Triple Equal or Strictly Equal or Strongly equal Operator ========");
console.log(" Is numOne equal to numTwo ==> ".concat(numOne === numTwo));
console.log(" Is numOne equal to numThree ==> ".concat(numOne === numThree));
console.log(" Is numOne equal to numFour ==> ".concat(numOne === numFour));
console.log("===== > Greater than Operator ========");
var numOne = 10;
var numTwo = 11;
var numThree = 11;
console.log(" Is numOne greater than numTwo ==> ".concat(numOne > numTwo));
console.log(" Is numTwo greater than numThree ==> ".concat(numTwo > numThree));
console.log("===== >= Greater than Equal Operator ========");
var numOne = 10;
var numTwo = 11;
var numThree = 11;
console.log(" Is numOne greater than Equal numTwo ==> ".concat(numOne >= numTwo));
console.log(" Is numTwo greater than Equal numThree ==> ".concat(numTwo >= numThree));
console.log("===== < Less than Operator ========");
var numOne = 10;
var numTwo = 11;
var numThree = 11;
console.log(" Is numOne Less than numTwo ==> ".concat(numOne < numTwo));
console.log(" Is numTwo Less than numThree ==> ".concat(numTwo < numThree));
console.log("===== >= Less than Equal Operator ========");
var numOne = 10;
var numTwo = 11;
var numThree = 11;
console.log(" Is numOne Less than Equal numTwo ==> ".concat(numOne <= numTwo));
console.log(" Is numTwo Less than Equal numThree ==> ".concat(numTwo <= numThree));